import React, {useState, useEffect} from 'react'

function Countdown(){
    const [clock, setClock] = useState(60)
    useEffect(() => {setClock(clock + 1)}, [])
    return (
        <div className = "countdown">
            <h1>{clock}s</h1>
        </div>

    )
}
export default Countdown
